import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import VIT from "../components/pages/image/VIT.svg";
import IEEE from "../assets/videos/IEEE.mp4";

function Footer() {
  useEffect(() => {
    AOS.init({ duration: 500 });
    AOS.refresh();
  }, []);

  return (
    <section className="Foot">
      <article data-aos="fade-up">
        <svg viewBox="0 0 600 300">
          <symbol id="s-text">
            <text text-anchor="middle" x="50%" y="50%" dy=".35em">I Study At</text>
          </symbol>
          <use class="text" xlinkHref="#s-text"></use>
          <use class="text" xlinkHref="#s-text"></use>
          <use class="text" xlinkHref="#s-text"></use>
          <use class="text" xlinkHref="#s-text"></use>
          <use class="text" xlinkHref="#s-text"></use>
        </svg>
      </article>
      <br />
      <img src={VIT} className="foot-img" data-aos="fade-up" />
      <br />
      <figcaption data-aos="fade-up">
        Vishwakarma Institute of Technology
      </figcaption>
      <br />
      <br />
      <article data-aos="fade-up">
        <div className="tim-head">Work At</div>
      </article>
      <br />
      <video
        data-aos="fade-up"
        src={IEEE}
        className="foot-img"
        autoPlay
        loop
        muted
        disablePictureInPicture
      />
      <br />
    </section>
  );
}

export default Footer;
